(function (tinymce) {
    tinymce.PluginManager.add("print", function (ed, url) {
        ed.addCommand("mcePrint", function () {
            ed.getWin().print()
        });
        
        ed.addButton("print", {
            title: "print.desc",
            cmd: "mcePrint"
        })
    })
})(wfe);